import React, { useState } from "react";
import { FaMapMarkedAlt, FaUsers, FaStar, FaGlobe, FaFacebook, FaInstagram } from "react-icons/fa";

const Aboutus = () => {
  const [isOpen, setIsOpen] = useState(false);
  const [form, setForm] = useState({ name: "", email: "", message: "" });
  const phoneNumber = "403-604-9794"; // Your contact number

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    /* eslint-disable */console.log(...oo_oo(`2306236670_15_4_15_39_4`,"Form submitted", form));
    // Send form data via email (backend integration needed)
    alert("Message sent successfully!");
    setForm({ name: "", email: "", message: "" });
  };

  return (
    <div className="bg-gray-100">
      {/* Hero Section */}

      {/* Social Media Links */}
      <div className="flex justify-center space-x-4 py-4">
        <a href="https://facebook.com" target="_blank" rel="noopener noreferrer">
          <FaFacebook className="text-3xl text-blue-600" />
        </a>
        <a href="https://instagram.com" target="_blank" rel="noopener noreferrer">
          <FaInstagram className="text-3xl text-pink-600" />
        </a>
      </div>

      {/* Our Story Section */}
      <div className="max-w-5xl mx-auto py-16 px-6 text-center">
        <h2 className="text-4xl font-bold text-gray-800">Our Story</h2>
        <p className="mt-4 text-lg text-gray-600">
          With 18 years of experience in the travel industry, we proudly help thousands of travelers create unforgettable experiences across the globe. Our mission is to make every journey seamless, enjoyable, and truly life-changing.
        </p>
      </div>

      {/* Contact Form */}
      <div className="max-w-lg mx-auto bg-white p-6 shadow-md rounded-lg">
        <h2 className="text-2xl font-bold text-gray-800 text-center">Contact Us</h2>
        <form onSubmit={handleSubmit} className="mt-4">
          <input 
            type="text" 
            name="name" 
            placeholder="Your Name" 
            value={form.name} 
            onChange={handleChange} 
            className="w-full p-2 border rounded mb-3"
            required 
          />
          <input 
            type="email" 
            name="email" 
            placeholder="Your Email" 
            value={form.email} 
            onChange={handleChange} 
            className="w-full p-2 border rounded mb-3"
            required 
          />
          <textarea 
            name="message" 
            placeholder="Your Message" 
            value={form.message} 
            onChange={handleChange} 
            className="w-full p-2 border rounded mb-3"
            required
          ></textarea>
          <button 
            type="submit" 
            className="w-full p-2 bg-blue-600 text-white rounded hover:bg-blue-700"
          >
            Send
          </button>
        </form>
      </div>
    </div>
  );
};

export default Aboutus;
